import React, { useEffect, useState } from "react";
import RoleItem from "../../components/RoleItem/RoleItem";
import { URL_GOOGLE_SHEETS } from "../../constants";
import SheetApi from "g-sheets-api";

const RolezandoList = () => {
  const [list, setList] = useState({});
  const [hasError, setHasError] = useState(false);

  useEffect(() => {
    const data = fetch(URL_GOOGLE_SHEETS).then((res) => res.text());

    data.then((result) => {
      const resp = result
        .replace("google.visualization.Query.setResponse(", "")
        .replace("/*O_o*/", "")
        .replace("\n", "")
        .replace(");", "");

      const response = JSON.parse(resp);

      console.log(response);

      const headers = response.table.cols.map((item) => item.label);

      const data = [];

      response.table.rows.forEach((item, index) => {
        item.c.forEach((value) => {
          console.log(value.v);

          data.push({
            createdBy: value.v,
            createdAt: value.v,
            name: value.v,
            city: value.v,
            category: value.v,
            price: value.v,
            hasPlaceToChildren: value.v,
            points: value.v,
            comment: value.v,
          });
        });
      });

      console.log(data);

      // setList({ data, headers });
    });
  }, []);

  return (
    <>
      {JSON.stringify(list)}
      {/* {list.map((item) => (
        <RoleItem data={item} />
      ))} */}
    </>
  );
};

export default RolezandoList;
